import React from "react";
import "./OnBording1.css";

function OnBording({ Heading1, Heading2, Heading3, Para, Img }) {
  console.log(Img);
  return (
    <div className="OnBording1">
      <div className="OnBording1_inner">
        <div className="OnBording1_inner_Top">
          <h5>
            Food-<span>D-2</span>
          </h5>
        </div>
        <div className="OnBording1_inner_Bottom">
          <h1>
            {Heading1} <br /> {Heading2}
            <span>{Heading3}</span>
          </h1>
          <h5>{Para}</h5>
          <button>NEXT</button>
        </div>
      </div>
    </div>
  );
}

export default OnBording;
